          if($('.hov2').css('display') == 'block') {
            $('.hov2').toggle('slide');
          }
        }
      });

      var i = 0;

      setTimeout(function() {
        $('[data-dom="yes"]').each(function () {

          var w = $(this).get(0).getBoundingClientRect().width;
